import React from 'react';
import Navbar from '../fragments/Navbar';

function Info() {
    return (
        <div>
            <Navbar />
            <div>
                <h1>임시 사용 설명서 입니다</h1>
                <p>1. 카오스던전, 가디언토벌 우측 버튼 오른쪽 클릭시 휴식게이지를 수정할 수 있습니다.</p>
                <p>2. 돋보기 버튼 클릭시 해당 컨텐츠의 통계를 알 수 있습니다.</p>
                <p>3. 주간숙제 관리는 최대 3개까지 가능합니다.</p>
            </div>
        </div>
    );
}

export default Info;
